function specialBlocks() {
	var query = '//table[@class="map"]//td//div[@class="p"]';
	var blocks = document.evaluate(query, document, null, XPathResult.UNORDERED_NODE_SNAPSHOT_TYPE, null);
	
	for (var i = 0; i < blocks.snapshotLength; i++) {
		var currentBlock = blocks.snapshotItem(i).parentNode;
		var coordinates = blocks.snapshotItem(i).innerHTML;
			
		// mall blocks
		if (currentBlock.className.match(/mall/)) {
			// northwest mall
			if (coordinates.match(/(32,44|43,9|78,73|49,98|19,27|25,9|75,28|84,41|66,55|90,79|99,77|28,76|85,65|58,52|52,80|52,23|20,81|92,7|67,44|62,62)/)) {
				currentBlock.className += ' mall-nw';
			}
			// northeast mall
			else if (coordinates.match(/(33,44|44,9|79,73|50,98|20,27|26,9|76,28|85,41|67,55|91,79|29,76|86,65|59,52|53,80|53,23|21,81|93,7|68,44|63,62)/)) {
				currentBlock.className += ' mall-ne';
			}
			// southwest mall
			else if (coordinates.match(/(32,45|43,10|78,74|49,99|19,28|25,10|75,29|84,42|66,56|90,80|99,78|28,77|85,66|58,53|52,24|20,82|92,8|67,45|62,63)/)) {
				currentBlock.className += ' mall-sw';
			}
			// southeast mall
			else if (coordinates.match(/(33,45|44,10|79,74|50,99|20,28|26,10|76,29|85,42|67,56|91,80|29,77|86,66|59,53|53,81|53,24|21,82|93,8|68,45|63,63)/)) {
				currentBlock.className += ' mall-se';
			}
		}
		// stadium blocks
		else if (currentBlock.className.match(/stad/)) {
			if (coordinates.match(/(51,81|47,43|60,6)/)) {
				currentBlock.className += ' stad-nw';
			}
			else if (coordinates.match(/(48,43|61,6)/)) {
				currentBlock.className += ' stad-ne';
			}
			// stadium overlaps mall
			else if (coordinates.match(/52,81/)) {
				currentBlock.className += ' stad-mall';
			}
			else if (coordinates.match(/(51,82|47,44|60,7)/)) {
				currentBlock.className += ' stad-sw';
			}
			else if (coordinates.match(/(52,82|48,44|61,7)/)) {
				currentBlock.className += ' stad-se';
			}
		}
		// mansion blocks
		else if (currentBlock.className.match(/mnsn/)) {
			if (coordinates.match(/(51,36|67,4|57,58|21,0|49,8)/)) {
				currentBlock.className += ' mnsn-nw';
			}
			else if (coordinates.match(/(52,36|68,4|58,58|22,0|50,8)/)) {
				currentBlock.className += ' mnsn-ne';
			}
			else if (coordinates.match(/(51,37|67,5|57,59|21,1|49,9)/)) {
				currentBlock.className += ' mnsn-sw';
			}
			else if (coordinates.match(/(52,37|68,5|58,59|22,1|50,9)/)) {
				currentBlock.className += ' mnsn-se';
			}
		}
		// fort blocks
		else if (currentBlock.className.match(/(fbar|finf|fsto|ftgr|fexy|fgat|fvdp)/)) {
			if (coordinates.match(/(78,47|84,89)/)) {
				currentBlock.className += ' c310';
			}
			else if (coordinates.match(/(79,47|85,89)/)) {
				currentBlock.className += ' c311';
			}
			else if (coordinates.match(/(80,47|86,89)/)) {
				currentBlock.className += ' c312';
			}
			else if (coordinates.match(/(78,48|84,90)/)) {
				currentBlock.className += ' c313';
			}
			else if (coordinates.match(/(80,48|86,90)/)) {
				currentBlock.className += ' c314';
			}
			else if (coordinates.match(/(78,49|84,91)/)) {
				currentBlock.className += ' c315';
			}
			else if (coordinates.match(/(79,49|85,91)/)) {
				currentBlock.className += ' c316';
			}
			else if (coordinates.match(/(80,49|86,91)/)) {
				currentBlock.className += ' c317';
			}
		}
		
	}
}
